function getApproved(uint256 tokenId) public view returns (address) {
    if (tokenId >= totalSupply()) {
        revert URIQueryForNonexistentToken();
    }

    address approvedAddress = address(approvedAddresses[tokenId]);
    return approvedAddress;
}

